representations/readme.html.body:
Resource representations
The main method of Alcaeus client is loadResource(string) which performs a GET
request for the given identifier and returns an object wrapping the XHR object and the actual response. The
JS object will implement the below interface. 
export interface IResponseWrapper {
    /**
     * Gets the URI used to perform the request
     */
    readonly requestedUri: string;

    /**
     * Gets the response content type, as advertised in response HTTP header
     */
    mediaType: string;

    /**
     * Gets the URI identifying the ApiDocumentation resource if present in the
     * response Link header
     */
    apiDocumentationLink: string;

    /**
     * If the request was redirected, returns the target resource
     */
    redirectUrl: string;

    /**
     * Gets the actual XMLHttpResponse object which can be used to do custom
     * processing
     */
    xhr: Response;
}

representations/hydra.html.body:
Hydra resource representations
A natural, special case for Alcaeus are resources actually represented in one of RDF serializations.
Whenever such representation is retrieved, the object returned from loadResource will include additional
methods for accessing the resource withing the returned payload.
interface IHydraResponse extends Iterable {
    /**
     * Gets the root of the representation or undefined if it cannot be determined
     */
    root: IHydraResource;

    /**
     * Gets the number of resource within this representation
     */
    length: number;

    /**
     * Indexer to look up any arbitrary resource by its id within the representation
     */
    get(uri: string): IHydraResource;

    /**
     * Gets all resources of given RDF type from the representation
     * @param {string} classId RDF class identifier
     * @returns {Array}
     */
    ofType(classId: string): IResource[];
}

See the subpages for more details about individual members of the IHydraResponse interface:

IHydraResponse.get(string)
IHydraResponse.root
IHydraResponse.ofType(string)
Iterable

representations/get.html.body:
Getting arbitrary resource
If you know a specific resource identifier you want to retrieve from a resource representation you can take
advantage of a handy getter method from IHydraResource object comes with which gives access to specific
resources.

const client = require("alcaeus@0.10.7").Hydra;

const rep = await client.loadResource('https://sources.test.wikibus.org/books');

rep.get('https://sources.test.wikibus.org/books/5');

 Note, that the individual resources are "real" JavaScript objects, and hence everything is fully traversable
 by indexing with property names or using the dot notation.

representations/by-type.html.body:
Selecting resources by type
The representation returned by Alcaeus#loadResource comes with a handy method which returns resources of
the given RDF type. Code speaks louder than words so here's an example:

const client = require("alcaeus@0.10.7").Hydra;

const resources = await client.loadResource('https://sources.test.wikibus.org/books/3');

resources.ofType('http://schema.org/Book')
         .map(book => book['http://purl.org/dc/terms/title']);

representations/iterating.html.body:
Iterating all resources
The representation returned by Alcaeus#loadResource implements the well-known Symbol.iterator, which means
that it can be used directly in a for..of loop.

const client = require("alcaeus@0.10.7").Hydra;

const resources = await client.loadResource('https://sources.test.wikibus.org/');

for(let res of resources) {
  console.log(res.id);
}

The representation itself doesn't implement the Array interface but it can be trivially converted into one
so that more complex operation can be performed.
Here's an example which counts the occurrences of RDF types within an ApiDocumentation.

const client = require("alcaeus@0.10.7").Hydra;

const resources = await client.loadResource('https://sources.test.wikibus.org/doc');

Array.from(resources).reduce((acc, item) => {
            item.types.forEach(type => {
                acc[type] = acc[type] ? acc[type] + 1 : 1;
            });
            return acc;
         }, {});

representations/collections.html.body:
Collections



Manages block
Paged (partial) collections



Hydra specifications defines an interface for collections. A basic collection is represented by an array of
its items (members) and the total number of items.
interface ICollection {
    /**
     * Gets the total number of items within the entire collection.
     * Note that this number can be larger then the number of `members` in the case of
     * a partial collections
     */
    readonly totalItems: number;
    /**
     * Gets the collection member included in the current representation.
     * In the case of partial collections they may only be a subset of all members
     */
    readonly members: IHydraResource[];
    /**
     * Gets the views of a partial collection
     */
    readonly views?: IView[];
    /**
     * Gets the manages block for current collection
     */
    readonly manages: IManagesBlock[];
}

Here's an example of loading a collection which is not paged. In such case the server should respond with a
representation where the totalItems property equals members.length.

const client = require("alcaeus@0.10.7").Hydra;

const rep = await client.loadResource('https://sources.test.wikibus.org/magazine/Buses/issues');

rep.root;

Manages block
Hydra introduces the so-called "manages block" which adds additional metadata to collections. It can serve
two purposes:
 Inform clients about collection members' relation with another resource 
 Inform clients about the type of collection elements
In case of member relations, a manages block can look like this (excerpt):
{
  "@id": "https://sources.test.wikibus.org/magazine/Buses/issues",
  "manages": {
    "subject": "https://sources.test.wikibus.org/magazine/Buses",
    "predicate": "dcterms:isPartOf"
  }
}

This tells the client that all members of the /magazine/Buses/issues collection are in relation with 
/magazine/Buses defined as
?member dcterms:isPartOf  .
The second case is to declare that all members will be of a certain type:
{
  "@id": "https://sources.test.wikibus.org/magazine/Buses/issues",
  "manages": {
    "predicate": "rdf:type",
    "object": "https://wikibus.org/vocab#MagazineIssue"
  }
}

Alcaeus will explicitly add all triples which are implicitly stated about
collection members.

Here's an example showing how the manages block is retrieved from a collection to find the rdf:type
of collection members. Nothing more than a simple array filter.

const { Hydra } = require('alcaeus@0.6.0-beta.1')
const rdfType = 'http://www.w3.org/1999/02/22-rdf-syntax-ns#type'

const rep = await Hydra.loadResource('https://sources.test.wikibus.org/magazines')

rep.root.manages.find(managesBlock => managesBlock.property.id === rdfType)

Do see the hydra:collection page for details on discovering
collections based on their manages block specifications.

Paged (partial) collections
It is a common scenario to split a large collections into smaller chunks. Typically called pages, Hydra
uses the term view which means to be more generic way of splitting the collection. Currently the only
one actually specified is a PartialCollectionView. Alcaeus represents it by implementing the
IPartialCollectionView.
export interface IPartialCollectionView {
    /**
    * Gets the first page of a collection
    */
    readonly first: IHydraResource;
    /**
    * Gets the previous page of a collection
    */
    readonly previous: IHydraResource;
    /**
    * Gets the next page of a collection
    */
    readonly next: IHydraResource;
    /**
    * Gets the last page of a collection
    */
    readonly last: IHydraResource;
    /**
     * Gets the actual collection resource, of which this view is part of
     */
    readonly collection: HydraResource;
}

It is important to notice that requesting a page will actually return the collection object. The view serves
only as metadata for how to retrieve more pages or views but the members will still be "attached" to the
actual collection resource.

const client = require("alcaeus@0.10.7").Hydra;

const rep = await client.loadResource('https://sources.test.wikibus.org/magazines?page=2');

rep.root;

This design has the consequence that it is possible to combine individual view (page) resources by simply
concatenating members of each one. Combining all pages should produce the complete collection.

representations/resource-properties.html.body:
Working with resource properties



Literal properties
get and getArray
Typed helper methods



Individual resources can come with properties of different values of properties.
Because JavaScript is a very loose language, weird problems can go undetected until
runtime.
Alcaeus' base Resource class comes with a few handy helper methods which can be used
to retain some type checking at run time as well as during development time in the
case of TypeScript.
Literal properties
Alcaeus will convert the RDF literals, which are strings, to their respective JS
representation based on the datatype. By default numeric xsd types and xsd:boolean
are converted.

const { Hydra } = require("alcaeus@0.10.7");

const collection = (await Hydra.loadResource('https://sources.test.wikibus.org/brochures')).root;

// hydra:totalItems is a "real" number
Number.isInteger(collection.totalItems)

It is also possible to add a custom converter:

const { Hydra } = require("alcaeus@0.10.7")
const { Duration } = require('luxon')

// hook up a converter
Hydra.mediaTypeProcessors.RDF.literalConverters['http://schema.org/Duration'] = 
    (value, type) => {
        // type can be used if a converter
        // handles multiple datatypes

        return Duration.fromISO(value)
    }

// get the operation
const root = (await Hydra.loadResource('https://hydra-movies.herokuapp.com/')).root;
const collection = root.getCollections()[0]
const operation = collection.operations[0]

// invoke (it will echo a Movie with its duration)
const newMovie = {
   '@context': 'http://schema.org/',
   'schema:duration': 'PT115M'
 }

// invoke the operation
const movie = (await operation.invoke(JSON.stringify(newMovie))).root

// check that the movie's duration property gets converted
movie.duration.minutes === 115

get and getArray
A most generic type of property accessors are two methods which take a property name
and return the value or values of that property.
They are very similar to the built-in indexer and differ in a few details:

getArray will ensure that a single values is wrapped in an Array
get returns null instead of undefined
both can be used a generics, but it serves only as compiler hint

Typed helper methods
There is a handful of typed methods to get literals:

getNumber
getString
getBoolean

All of the will throw if the actual value is not of the expected type.
That includes an array, even if it contain all values of that type.

representations/mixins.html.body:
Extending resource objects with mixins



Adding mixins to resource
Example
Helper methods


Built-in mixins



Working with absolute URI properties can prove cumbersome. After all who would want to write code like:
resource['http://schema.org/author']['http://schema.org/name'];

This is verbose, error prone and probably will be an issue for declarative binding syntax of some libraries
(I'm looking at you, Polymer).
Resources returned from Alcaeus are composed of JavaScript mixins applied on top of plain JS objects coming from
the JSON-LD processing algorithms. Mixins allow creating friendly getters for RDF properties, and methods
adding some behaviour to your resources.
Adding mixins to resource
There are two steps necessary to apply a mixin:

Create an object with two members which implements the below interface
  type Constructor = new (...args: any[]) => T;
  interface IMixin {
      Mixin: Constructor;
      shouldApply(obj: IHydraResource): boolean;
  }


Add the object to Alcaeus's ResourceFactory


The Mixin property is, obviously, the actual mixin to apply when creating objects from JSON-LD resources.
The shouldApply function is used to choose whether a given mixin should be used with a given resource.
 If shouldApply is missing, the mixin will be ignored.

Example

const client = require("alcaeus@0.10.7").Hydra;

const Mixin = Base => {
  return class extends Base {
    get authorName() {
      return this['http://schema.org/author']['http://schema.org/name'];
    }
  };
};

const shouldApply = resource => {
  return resource.hasType('http://schema.org/Book');
};

// Add mixin to the client
client.mediaTypeProcessors.RDF.resourceFactory.mixins.push({ Mixin, shouldApply });

const rep = await client.loadResource('https://sources.test.wikibus.org/book/1331');

// access property defined in mixin
rep.root.authorName;

 A clean way is to export the Mixin and shouldApply function, which is then easily imported to
 add to resource factory.

// AuthorMixin.js
export function Mixin(Base) {
  return class extends Base {};
}

export const shouldApply = () => true;

// index.js
import Hydra from 'alcaeus';
import * as AuthorMixin from './AuthorMixin';

Hydra.mediaTypeProcessors.RDF.resourceFactory.mixins.push(AuthorMixin);

Helper methods
When defining a resource mixin it is possible to take advantage of protected methods which make it easier to
access the underlying triples.
export function Mixin(Base) {
  return class extends Base {
    get authorName() {
      // The `_get` method will simply return coalesce missing property to a `null`
      // In other words, it will prevent the `undefined` value from being returned
      return this._get('http://schema.org/author');
    }

    get chapters() {
      // `_getArray` will ensure that an `Array` is always returned:
      // * Wrapping a non-array value
      // * Empty array if the property is missing
      return this._getArray('http://purl.org/ontology/bibo/chapter');
    }
  };
}

Built-in mixins
Alcaeus includes a number of mixins which are applied to elements of the Hydra vocabulary. These are mainly
resources within the ApiDocumentation but also Collection and PartialCollectionView.

representations/resource-affordances.htm.body:
Resource affordances



Getting resource's operations
Accessing entire ApiDocumentation



In addition to the basic types and id properties resource objects will also
include two properties giving access to hypermedia descriptions coming from the API Documentation.
Getting resource's operations
Resource objects come with an operations property which will return an array of IOperation
instances which represent a combination of

inline operations
supported operations for all of the resource's types
supported operations for the supported property, where the resource is an object of said property

Especially the last point can be a bit mind-boggling so here's an example. First, here's excerpt from the API
Documentation.
{
  "@type": "ApiDocumentation",
  "supportedClass": [
    {
      "@type": "v:Person",
      "supportedOperation": [{
        "@type": "v:UpdatePerson",
        "method": "PUT",
        "description": "Updates the person"
      }],
      "supportedProperty": [{
        "property": {
          "@type": "v:homeAddress",
          "supportedOperation": [{
            "@id": "v:RemoveAddress",
            "method": "DELETE",
            "description": "Deletes the address"
          }]
        }
      }]
    },
    {
      "@type": "v:Address",
      "supportedOperation": [{
        "@type": "v:UpdateAddress",
        "method": "PUT",
        "description": "Updates the address"
      }]
    }
  ]
}

From the above you can read that a classes Person and Address supports a PUT operation to update them.
Additionally person's home address object will support a DELETE operation, regardless of its type.
Now, let's combine this with a resource representation:
{
  "@id": "/a/person",
  "v:homeAddress": {
    "@type": "v:Address"
  },
  "operation": [{
    "@type": "v:RequestFriend",
    "method": "POST",
    "description": "Creates a friend request"
  }]
}

With these documents you can use the client to get the resources' operations, which will produce results as
described in the below snippet.
import {Hydra} from 'Alcaeus';

const representation = await Hydra.loadResource('/a/Person');
const person = representation.root;

/*
 * will return operations:
 * v:RequestFriend (inline)
 * v:UpdatePerson (supported by class v:Person)
 */
const personOperations = person.operations;

/*
 * will return operations:
 * v:UpdateAddress (supported by type v:Address)
 * v:RemoveAddress (supported by objects of property v:homeAddress)
 */
const addressOperations = person["v:homeAddress"].operations;

Accessing entire ApiDocumentation
Additionally every resource object comes provides a apiDocumentation getter which returns a tree loaded
from the linked ApiDocumentation.

const client = require("alcaeus@0.10.7").Hydra;

const rep = await client.loadResource('https://sources.test.wikibus.org/');

rep.root.apiDocumentation.valueOr(null);

For more information about the API Documentation please refer to its dedicated page and child pages.

representations/affordances/links.html.body:
Links



Not all resources are meant to be dereferenced
Annotated links
Links within a resource representation
Links within ApiDocumentation



Links have a special place in any hypermedia media types. In most formats links are an independent
piece of the object model, such as a __links property etc.
Hydra is different given that it's based on RDF data model. In RDF any property whose object is
a resource (URI node) could be treated as a link.
 foaf:knows 
Not all resources are meant to be dereferenced
The problem this causes is that without additional information, the client has no way to tell
if a given resource is actually intended for dereferencing. In other words it does not make sense
to follow every "potential link relation".
This could apply to resources from external APIs over which there is no control and likely are
not part of another Hydra API. Also, some resources within an API could be write-only, only accepting
POST requests but without support for the GET method.
Annotated links
Hydra has the ability to explicitly mark links without the necessarily resorting to a SupportedOperation.
Instead, it's simply required to use hydra:Link type for supported RDF properties.
{
  "@context": {
    "@vocab": "http://www.w3.org/ns/hydra/core#",
    "foaf": "http://xmlns.com/foaf/0.1/" 
  },
  "@type": "ApiDocumentation",
  "supportedClass": [
    {
      "supportedProperty": [
        {
          "property": {
            "@id": "foaf:knows",
            "@type": "Link"
          }
        }
      ]
    }
  ]
}

hydra:Link is subclass of rdfs:Property so it may not necessary to explicitly type is as such.

Adding hydra:Link type to properties coming from third party vocabularies may have unexpected side
effects if the Hydra statements are leaked into other datasets.

Links within a resource representation
Each resource object fetched from a Hydra-compliant API implements a method
which returns a set of links and their values.

const { Hydra } = require("alcaeus@0.10.7")

const rep = await Hydra.loadResource('https://sources.test.wikibus.org/')

rep.root.getLinks()

Properties defined as hydra:Link but not used by the given resource will not be included in the result.
To get all properties, call getLinks(true).

Links within ApiDocumentation
Below snippet shows how isLink property can be used to check if a property used
in SupportedProperty is typed as a link. 

const { Hydra } = require("alcaeus@0.10.7")

const rep = await Hydra.loadResource('https://sources.test.wikibus.org/')

const apiDoc = rep.root.apiDocumentation.valueOrThrow()
  .getClass('https://wikibus.org/api#EntryPoint')
  .supportedProperties.map(sp => ({
    id: sp.property.id, isLink: sp.property.isLink
  }))

representations/affordances/collection-p.body:
hydra:collection property



Discovering specific collections



Hydra offers a specialized property to link to collections without the need for minting a new
relation every time such link is required.
{
  "@context": {
    "collection": {
      "@id": "http://www.w3.org/ns/hydra/core#collection",
      "@type": "@id"
    }
  },
  "collection": "http://example.com/collection"
}

It can easily be accessed from the resource itself using a dedicated getter method

const { Hydra } = require("alcaeus@0.10.7")

const rep = await Hydra.loadResource('http://hydra-movies.herokuapp.com')

rep.root.getCollections()

Discovering specific collections
The getCollections method accepts an optional parameter which is used to find only
collections conforming to given "manages block" pattern.
Below is an example for finding collection with members of a given SupportedClass.
const { Hydra } = require("alcaeus")

const rep = await Hydra.loadResource('http://hydra-movies.herokuapp.com')
const supportedClass = rep.root.apiDocumentation.classes[0]

rep.root.getCollections({
    object: supportedClass
})

 When using the object parameter, predicate will implicitly be rdf:type. Changing
 it to anything else will cause an empty result.

Second option is to look for collections by subject and predicate:
const { Hydra } = require("alcaeus")

const rep = await Hydra.loadResource('http://hydra-movies.herokuapp.com')

rep.root.getCollections({
    subject: 'https://sources.test.wikibus.org/magazine/Buses',
    predicate: 'http://purl.org/dc/terms/isPartOf'
})

 You may notice in the second snippet that strings are used for subject
 and predicate parameters. Same is true for object; all three parameters can be either
 strings (URI) or resource objects.

representations/affordances/invoking-ope.body:
Operations



Invoking
Media type
Target



Invoking
When the client gets hold of an Operation object, they can invoke, which
performs an actual web request according to the operation's description.
The invoke method has a single required parameter: the body. It it expected to
be any of the body types accepted by fetch body parameter.

const { Hydra } = require("alcaeus@0.10.7");

// get the issues collection & fetch the first member
const rep = await Hydra.loadResource('http://www.markus-lanthaler.com/hydra/api-demo/issues/');
const issue = (await rep.root.members[0].load()).root

// find POST operation on the `#Issue/comments` property
const comments = issue['http://www.markus-lanthaler.com/hydra/api-demo/vocab#Issue/comments']
const operation = comments.operations.find(o => o.method === 'POST')

// prepare the request body
const newComment = {
   '@context': {
     '@vocab': 'http://www.markus-lanthaler.com/hydra/api-demo/vocab#'
   },
   '@type': 'Comment',
   'Comment/text': 'Comment from Alcaeus doc pages'
 }

// invoke the operation
await operation.invoke(JSON.stringify(newComment))

 Note that the invoke method does not accept objects. If the client operates on JSON-LD
 objects, the body must be serialized as shown above.

Media type
By default the operation request will be sent with application/ld+json content type. If the client
wishes to send the payload in another format, the second parameter can be used to set the correct
header value.
 Sending FormData object, such as when uploading files with multipart request,
 will not set the content-type to let the fetch implementation set it with correct
 boundary.


const { Hydra } = require("alcaeus@0.10.7");

// get the issues collection & fetch the first member
const rep = await Hydra.loadResource('http://www.markus-lanthaler.com/hydra/api-demo/issues/');
const issue = (await rep.root.members[0].load()).root

// find POST operation on the `#Issue/comments` property
const comments = issue['http://www.markus-lanthaler.com/hydra/api-demo/vocab#Issue/comments']
const operation = comments.operations.find(o => o.method === 'POST')

// prepare the request body
const newCommentTurtle = `
@prefix :  .
@prefix comment:  .

<> a :Comment ;
   comment:text "Comment from Alcaeus doc pages" .`

// invoke the operation
await operation.invoke(newCommentTurtle, 'text/turtle')

Target
Currently the operation is always invoked on the resource it is attached to as this is
the design of Hydra at the moment. The original resource which declared the operation can
be accessed using a property of an Operation object.

const { Hydra } = require("alcaeus@0.10.7");

// get the operation
const root = (await Hydra.loadResource('https://hydra-movies.herokuapp.com/')).root;
const collection = root.getCollections()[0]
const operation = collection.operations[0]

// proof
operation.target.id === collection.id

representations/affordances/finding-oper.body:
Finding operations



Find direct operations of a resource
Find operations of resource and its children in graph
Getting unfiltered operations



Clients may ne interested in very specific operations, for example
only ones implemented by a GET method or expecting a specific type of payload.
Alcaeus resources implement some handy methods which let clients easily find the operations
that they need.
Find direct operations of a resource
With an instance of a HydraResource it is possible to filter out operations
by matching the HTTP method, the expected and the returned class.

const { Hydra } = require('alcaeus@0.10.7')
const { expand } = require('@zazuko/rdf-vocabularies')

const { root } = await Hydra.loadResource('https://hydra-movies.herokuapp.com/')
const [ collection ] = root.getCollections()

return collection.findOperations({
  byMethod: 'post',
  bySupportedOperation: expand('schema:CreateAction'), // matches hydra:SupportedOperation's @id and @type
  expecting: expand('schema:Movie'), // matches hydra:expects
  returning: expand('schema:Movie'), // matches hydra:returns
})

 Each one of the criteria can also be function which takes a single
 parameter (the method name, Class or SupportedOperation object)
 and returns true/false to indicate whether to return the operation.

For a single constraints object, all of its criteria must be satisfied for
an operation to be returned. The method also accepts zero or more such objects,
which will returns a logical alternative. 
For example, to find operation which return schema:Person or schema:Company
one would call the method with two parameters:
import { expand } from '@zazuko/rdf-vocabularies'
import {HydraResource} from 'alcaeus/types/Resources'
let resource: HydraResource

resource.findOperations({
  returning: expand('schema:Person')
}, {
  returning: expand('schema:Company')
})

 Unless byMethod is explicitly provided by the criteria object, GET operations
 will be implicitly excluded from the result. To simply get all operations, use the
 HydraResource#operations getter or see the getOperationsDeep() method below.

Find operations of resource and its children in graph
It is also possible to find operations across the entire resource graph using
a similar findOperationsDeep method. It also accepts criteria objects as
seen above.

const { Hydra } = require('alcaeus@0.10.7')
const { expand } = require('@zazuko/rdf-vocabularies')

const { root } = await Hydra.loadResource('https://hydra-movies.herokuapp.com/')

return root.findOperationsDeep({
  expecting: expand('schema:Movie'),
})

The first parameter can optionally be an object which excludes certain
branches from being traversed. It has a single array property which
blacklists properties

const { Hydra } = require('alcaeus@0.10.7')
const { expand } = require('@zazuko/rdf-vocabularies')

const { root } = await Hydra.loadResource('https://hydra-movies.herokuapp.com/')

return root.findOperationsDeep({
  excludedProperties: expand('hydra:collection'),
})

 By default hydra:member property will be excluded to prevent returning
 operations of each collection member.

Getting unfiltered operations
Finally, there is the getOperationsDeep method. It acts similarly to
findOperationsDeep but does not do any filtering. It also takes a single,
optional parameter to exclude subgraphs.

const { Hydra } = require('alcaeus@0.10.7')

const { root } = await Hydra.loadResource('https://hydra-movies.herokuapp.com/')

return root.getOperationsDeep({
  excludedProperties: [],
})

The snippet above combines all operations from all nested resources. Note
the empty excludedProperties array which would remove impilict hydra:member
limitation.

api-documentation/readme.html.body:
API Documentation
As explained on the Affordances page, each and every resource object within a Hydra representation comes
with an apiDoumentation getter. This API Documentation is fetched from the web by following the HTTP Link
header as specified by Hydra.
 The Hydra server needs to give Alcaeus explicit permissions to read the Link header if CORS is enabled. In order to achieve that Access-Control-Expose-Headers has to contain Link.


const client = require("alcaeus@0.10.7").Hydra;
const li = require('parse-link-header');

const docUri = 'http://www.w3.org/ns/hydra/core#apiDocumentation';

const rep = await client.loadResource('https://sources.test.wikibus.org/');

console.log(`The documentation URI is: '${li(rep.xhr.headers.get('Link'))[docUri].url}'`);
const apiDoc = rep.root.apiDocumentation.valueOr(null);

The getter returns a Maybe object which makes it easier to handle representations
without it or when it failed to load for some reason.
 For a
 single representation (in other words a single call to loadResource) the documentation will be fetched
 exactly once. However there is no other caching yet.

The API documentation is a direct JS representation of the Hydra concepts: classes and their descriptions,
and the entrypoint link. Please see the child pages for more information.
It is also possible to load the documentation resource directly using dedicated method. It will return
a typical resource object. After all the API Documentation is also a JSON-LD resource like any other.

const client = require("alcaeus@0.10.7").Hydra;

await client.loadDocumentation('https://wikibus-data-test.gear.host/doc');

api-documentation/class.html.body:
Supported classes



Getting classes from documentation
rdfs:subClassOf



The core concept of Hydra is a class, which defines API-wide description of resource structures and their
behaviour. In addition to the standard interface of resource objects, classes define a number of handy
properties:
interface IClass {
    title: string;
    description: string;
    supportedOperations: ISupportedOperation[];
    supportedProperties: ISupportedProperty[];
}

Getting classes from documentation
First, it is possible to get all classes using a simple getter. It will return an array of all supported
classes from the documentation resource.

const client = require("alcaeus@0.10.7").Hydra;

const doc = await client.loadDocumentation('https://wikibus-data-test.gear.host/doc');

doc.classes;

If you know a specific RDF type you can also get look it up within the API documentation:

const client = require("alcaeus@0.10.7").Hydra;

const doc = await client.loadDocumentation('https://wikibus-data-test.gear.host/doc');

doc.getClass('https://wikibus.org/ontology#Book');

rdfs:subClassOf
Alcaeus recognizes subclassing of Supported Classes and will combine the supported
properties and supported operations from all parents. For example, consider the
ApiDocumentation below:
api:DereferencableClass a hydra:Class ;
  hydra:supportedOperation api:GetResource .

ex:Article rdfs:subClassOf api:DereferencableClass ;
  hydra:supportedProperty [
    hydra:property dcterms:title
  ] .

ex:PublishedArticle rdfs:subClassOf ex:Article ;
  hydra:supportedProperty [
    hydra:property schema:publishedOn
  ] .
Alcaeus will combine the definitions of parent classes and "learn" that:

ex:PublishedArticle supports dcterms:title inherited from ex:Article  
ex:PublishedArticle and ex:Article both support operation api:GetResource inherited from api:DereferencableClass

api-documentation/supported-property.htm.body:
Supported Property



Discovering properties from ApiDocumentation
Getting properties of an instance



A property is one of key concepts of RDF and, by extension to web links, the Internet at large. 
Properties as links connect resources, also across APIs. This fact easily makes properties 
the most important element of a APIs design.
But properties are of course not only links between resource but also simple datatype attributes.
Hydra builds on top of plain rdf:Property and defines a SupportedProperty class which
extends the raw construct with API-specific information important to the client.
Here's the SupportedProperty interface of Alcaeus (excerpt):
interface IDocumentedResource {
    title: string;
    description: string;
}

interface ISupportedProperty {
    readable: boolean;
    writable: boolean;
    required: boolean;
    property: RdfProperty;
}

interface IRdfProperty {
    range: Class;
    domain: Class;
    supportedOperations: SupportedOperation[];
    isLink: boolean;
}

type RdfProperty = IRdfProperty & IDocumentedResource;
type SupportedProperty = ISupportedProperty & IDocumentedResource;

Few things to notice here:

SupportedProperty wraps rdf:Property and adds additonal information attributes such as writability
and human-readable labels
A property can also define supported operations which will apply to all object where that property is used,
regardless of the type of the resource (learn more here)
The isLink getter is not backed by a property; its value is based on the property type. Learn more here

Discovering properties from ApiDocumentation
Given a reference to an ApiDocumentation and a class URI, it is possible to get all supported properties
of that class:

const { Hydra } = require("alcaeus@0.10.7")

const doc = await Hydra.loadDocumentation('https://wikibus-sources-staging.herokuapp.com/doc')

doc.getProperties('https://wikibus.org/ontology#Book')

Alternatively, it's possible to reach the same properties from an instance of Class:

const { Hydra } = require("alcaeus@0.10.7")

const doc = await Hydra.loadDocumentation('https://wikibus-sources-staging.herokuapp.com/doc')

doc.classes
    .getClass('https://wikibus.org/ontology#Book')
    .supportedProperties

Getting properties of an instance
Any instance of a resource can have multiple types, some of which are API's supported classes. 
For convenience a getProperties method also exists on all resource objects and returns a 
combined set of all types' supported properties as well as their values.
Here's an example which returns a key/value map of property labels and their values:

const { Hydra } = require("alcaeus@0.10.7")

const doc = await Hydra.loadResource('https://sources.test.wikibus.org/book/433')

doc.root.getProperties()
    .filter(tuple => tuple.objects.length > 0)
    .reduce((obj, tuple) => ({ 
        ...obj, 
        [tuple.supportedProperty.title]: tuple.objects
    }), {})

 getProperties() always returns all properties, even if those not used in a given resource.
 They can be filtered as seen above by excluding results with an empty objects array.

js-api/request-headers.html.body:
Request headers



Default request headers
Setting headers for a single request



Default request headers
It is possible to change the request headers for every request made by the Alcaeus
client.
Especially useful for setting authentication headers, the example below show
how the Accept header can be changed so that Turtle has higher priority over
JSON-LD.
Remember to set up a media type processor to parse the resource representation in 
the accepted content type.


const { Hydra } = require('alcaeus@0.10.7')
const ParserN3 = require('@rdfjs/parser-n3')

Hydra.defaultHeaders = {
  Accept: 'text/turtle, application/ld+json'
}
Hydra.mediaTypeProcessors.RDF.addParsers({
  'text/turtle': ParserN3
})

const rep = await Hydra.loadResource('https://sources.test.wikibus.org/')

rep.xhr.headers.get('content-type')

Alternatively, a function can be used to dynamically build the default headers
before each request.
Hydra.defaultHeaders = () => { /* headers */ }
Setting headers for a single request
Individual calls to Hydra.loadResource or IOperation#invoke also accept a
set of headers to be used for the following request.
import { Hydra } from 'alcaeus'

const res = await Hydra.loadResource('http://example.org/me', {
    Authorization: 'Bearer xyz'
})

res.root.operations[0].invoke(turtleBody, {
    Authorization: 'Bearer xyz',
    'Content-Type': 'text/turtle',
})

Also affects the accompanying request for the linked API Documentation.
